<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=RazdelPrilozhenijj/PrilozhenieDCLocal&amp;amp;v=cn6" class="">/Раздел&amp;nbsp;Приложений&amp;nbsp;/&amp;nbsp;Приложение&amp;nbsp;DC&amp;nbsp;Local&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=RazdelPrilozhenijj/PrilozhenieDCLocal&amp;amp;time=2010-03-19+10%3A05%3A51">2010-03-19 10:05:51&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=RazdelPrilozhenijj/PrilozhenieDCLocal&amp;amp;time=2010-03-19+10%3A23%3A24">2010-03-19 10:23:24&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">&lt;em>eCallerNormal&lt;/em>. Звонок завершился нормально с&amp;nbsp;посылкой “Release complete” от&amp;nbsp;оригинирующей стороны.&lt;br />
&lt;em>eCallerNormal&lt;/em>. Звонок завершился нормально с&amp;nbsp;посылкой “Release complete” от&amp;nbsp;терминирующей стороны. &lt;br />
&lt;em>eCallerDropTCP&lt;/em>. Звонок завершился без&amp;nbsp;получения “Release complete” в&amp;nbsp;результате обрыва TCP&amp;nbsp;соединения оригинирующей стороной.&lt;br />
&lt;em>eCallerDropTCP&lt;/em>. Звонок завершился без&amp;nbsp;получения “Release complete” в&amp;nbsp;результате обрыва TCP&amp;nbsp;соединения терминирующей стороной.&lt;br />
&lt;em>eRemoteGkDRQ&lt;/em>. Звонок завершился при&amp;nbsp;получении disangageRequest от&amp;nbsp;удаленного привратника.&lt;br />
&lt;em>eForceTerminateCall&lt;/em>. Звонок был&amp;nbsp;завершен в&amp;nbsp;принудительном порядке (останов MVTS, команда terminate call).&lt;br />
&lt;em>eTimeoutTCPConnectH225&lt;/em>. Не&amp;nbsp;было установлено H225 соединение с&amp;nbsp;терминирующей стороной в&amp;nbsp;течение 3 секунд.&lt;br />
&lt;em>eTimeoutConnectMsg&lt;/em>. Не&amp;nbsp;получено “Connect Message” в&amp;nbsp;течении 120 секунд.&lt;br />
&lt;em>eTimeoutRBT&lt;/em>. Не&amp;nbsp;получено “Alerting Message” в&amp;nbsp;течении 30 секунд.&lt;br />
&lt;em>eInvalidH225SizeCaller&lt;/em>. Получен H.225-пакет неверной длины от&amp;nbsp;оригинатора звонка.&lt;br />
&lt;em>eInvalidH225SizeCalled&lt;/em>. Получен H.225-пакет неверной длины от&amp;nbsp;терминатора звонка.&lt;br />
&lt;em>eInvalidH225MsgCaller&lt;/em>. Получен некорректный H.225-пакет от&amp;nbsp;оригинатора звонка.&lt;br />
&lt;em>eInvalidH225MsgCalled&lt;/em>. Получен некорректный H.225-пакет от&amp;nbsp;терминатора звонка.&lt;br />
&lt;em>eInvalidH225ReadCaller&lt;/em>. MVTS не&amp;nbsp;смог прочитать полученный от&amp;nbsp;оригинатора звонка H.225-пакет.&lt;br />
&lt;em>eInvalidH225ReadCalled&lt;/em>. MVTS не&amp;nbsp;смог прочитать полученный от&amp;nbsp;терминатора звонка H.225-пакет.&lt;br />
&lt;em>eDestinationUnreachable&lt;/em>. Не&amp;nbsp;найден соответствующий объект набора (dial peer) или&amp;nbsp;ни&amp;nbsp;один из&amp;nbsp;требуемых шлюзов не&amp;nbsp;был доступен.&lt;br />
&lt;em>eFailedTCPConnectH225&lt;/em>. Сбой при&amp;nbsp;установлении H225 сессии с&amp;nbsp;терминирующей стороной.&lt;br />
&lt;em>eInvalidCalledIpAddress&lt;/em>. Некорректный адрес терминатора звонка (согласно плану маршрутизации).&lt;br />
&lt;em>eFailedDecodeUUCaller&lt;/em>. MVTS не&amp;nbsp;смог декодировать поле &lt;!--notypo-->UserUserField&lt;!--/notypo--> в&amp;nbsp;пакете, полученном от&amp;nbsp;оригинатора звонка.&lt;br />
&lt;em>eInvalidTPKTCaller&lt;/em>. Ошибка в&amp;nbsp;заголовке пакета, полученного от&amp;nbsp;оригинатора звонка. Встречалась в&amp;nbsp;случае некорректной работы соответствующего шлюза.&lt;br />
&lt;em>eFailedDecodeUUCalled&lt;/em>. MVTS не&amp;nbsp;смог декодировать поле &lt;!--notypo-->User Field&lt;!--/notypo--> в&amp;nbsp;пакете, полученном от&amp;nbsp;терминатора звонка.&lt;br />
&lt;em>eDuplicateCallId&lt;/em>. Был&amp;nbsp;получен звонок с&amp;nbsp;Call ID, уже&amp;nbsp;используемом в&amp;nbsp;одном из&amp;nbsp;активных соединений (защита от&amp;nbsp;зацикливания звонков).&lt;br />
&lt;em>eInvalidTPKTCalled&lt;/em>. Ошибка в&amp;nbsp;заголовке пакета, полученного от&amp;nbsp;терминатора звонка. Встречалась в&amp;nbsp;случае некорректной работы соответствующего шлюза.&lt;br />
&lt;em>eTimeoutRouteAttempt&lt;/em>. Не&amp;nbsp;было установлено соединение с&amp;nbsp;терминирующим шлюзом в&amp;nbsp;течении 10 секунд после начала роута на&amp;nbsp;этот шлюз.&lt;br />
&lt;em>eTimeoutSetupMsg&lt;/em>. Не&amp;nbsp;был получен Setup Message в&amp;nbsp;течении 15 секунд.&lt;br />
&lt;em>eTimeoutRTPidle&lt;/em>. При&amp;nbsp;полном проксировании не&amp;nbsp;было голосового трафика в&amp;nbsp;течении 180 секунд. В&amp;nbsp;этом случае звонок считается зависшим и&amp;nbsp;завершается.&lt;br />
&lt;em>eFailedTCPConnectH245Caller&lt;/em>. Сбой при&amp;nbsp;установлении H245 сессии.&lt;br />
&lt;em>eInvalidSetupMsg&lt;/em>. Неверный Setup Message (в пакете отсутствуют поле &amp;#147;User&amp;#148; или&amp;nbsp;первым пришел не&amp;nbsp;“Setup Message”).&lt;br />
&lt;em>eMaxRerouteRetries&lt;/em>. Было совершено более 10 попыток рероута (защита от&amp;nbsp;зацикливания при&amp;nbsp;процедуре look ahead routing).&lt;br />
&lt;em>eMaxCapacityExceed&lt;/em>. Превышено максимально допустимое значение параметра capacity для&amp;nbsp;оригинатора звонка.&lt;br />
&lt;em>eRouteBlocked&lt;/em>. Маршрут «оригинатор-объект набора-терминатор» заблокирован интеллектуальной маршрутизацией.&lt;br />
&lt;em>eFailedTCPConnectH245Called&lt;/em>. Сбой при&amp;nbsp;установлении H245 сессии на&amp;nbsp;терминирующую вызов сторону.&lt;br />
&lt;em>eNotAllowedPrefix&lt;/em>. Попытка совершения вызова на&amp;nbsp;номер с&amp;nbsp;запрещенным префиксом.&lt;br />
&lt;em>eDuplicateCalledPartyNumber&lt;/em>. Превышено максимально разрешенное число вызовов с&amp;nbsp;одинаковым номером вызываемого абонента&lt;br />
&lt;em>eNoPacketTimeOut&lt;/em>. Звонок завершен по&amp;nbsp;причине отсутствия пакетов в&amp;nbsp;течение заданного периода времени.&lt;br />
&lt;em>eConsoleTerminatedCall&lt;/em>. Звонок завершен в&amp;nbsp;принудительном порядке командой terminate call.&lt;br />
&lt;em>eDialpeerCapacityExceeded&lt;/em>. Превышено максимально допустимое значение параметра сapacity= для&amp;nbsp;объекта набора.&lt;br />
&lt;em>eGatewayUnaccessible&lt;/em>. Недоступность терминирующего шлюза.&lt;br />
&lt;em>eGatewayIncompatible&lt;/em>. Несовместимость оригинирующего и&amp;nbsp;терминирующего шлюзов по&amp;nbsp;полю compatibility.&lt;br />
&lt;em>eDestinationGatewayCapacityExceeded&lt;/em>. Превышено максимально допустимое количество звонков для&amp;nbsp;данного терминирующего шлюза, заданное в&amp;nbsp;поле capacity.&lt;br />
&lt;em>eGatewayNullReached&lt;/em>. Маршрутизация вызова завершена с&amp;nbsp;причиной Q931 в&amp;nbsp;результате обнаружения объекта набора с&amp;nbsp;параметром gateway=NULL&lt;br />
&lt;em>eHuntStopped&lt;/em>. Поиск по&amp;nbsp;объектам набора остановлен при&amp;nbsp;значении параметра hunt_stop=1&lt;br />
&lt;em>eNoAppropriateDialpeer&lt;/em>. Не&amp;nbsp;найден подходящий диалпир при&amp;nbsp;поиске маршрута для&amp;nbsp;терминации.&lt;br />
&lt;em>eMaxCallRateExceeded&lt;/em>. Превышена максимальная скорость нарастания вызовов, указанная в&amp;nbsp;поле max_callrate= (meraproxy.cfg [H.323]).&lt;br />
&lt;em>eRadiusAdmissionCallerReject&lt;/em>. Radius-сервером отклонена авторизация оригинатора звонка.&lt;br />
&lt;em>eGkClientAdmissionTimeout&lt;/em>. На&amp;nbsp;запрос Admission Request от&amp;nbsp;удаленного привратника (gatekeeper) не&amp;nbsp;получен ответ в&amp;nbsp;течении 10 секунд.&lt;br />
&lt;em>eSourceGatewayUnknown&lt;/em>. Получен звонок с&amp;nbsp;неизвестным адресом оригинатора (при прохождении звонка через конвертер SIP-HIT).&lt;br />
&lt;em>eGkClientAdmissionReject&lt;/em>. Запрос Admission Request отклонен удаленным привратником (gatekeeper).&lt;br />
&lt;em>eSourceGatewayAniReject&lt;/em>. Параметр src_number оригинатора не&amp;nbsp;совпадает с&amp;nbsp;номерами, указанными в&amp;nbsp;поле ani_allow описания шлюза или&amp;nbsp;RAS-пользователя.&lt;br />
&lt;em>eRadiusAdmissionTimeout&lt;/em>. Radius-сервер не&amp;nbsp;ответил на&amp;nbsp;запрос в&amp;nbsp;течении 10 секунд.&lt;br />
&lt;em>eRadiusAdmissionCallerReject&lt;/em>. Radius-сервером отклонена авторизация терминатора звонка.&lt;br />
&lt;em>eRadiusAdmissionRouteReject&lt;/em>. Radius-сервер отказал во&amp;nbsp;внешней маршрутизации.&lt;br />
&lt;em>eRouteProhibited&lt;/em>. Звонок с/на запрещенный адрес.&lt;br />
&lt;em>eIncomingBandwidthOverload&lt;/em>. Превышена входящая ширина полосы пропускания IP-адреса при&amp;nbsp;использовании параметра &amp;laquo;local_ip_manager=".&lt;br />
&lt;em>eOutcomingBandwidthOverload&lt;/em>. Превышена исходящая ширина полосы пропускания IP-адреса при&amp;nbsp;использовании параметра &amp;laquo;local_ip_manager=".&lt;br />
&lt;em>eOutgoingDestNumberEmpty&lt;/em>. Предпринята попытка отправить Setup с&amp;nbsp;пустым полем &lt;!--notypo-->&amp;quot;CalledStationId&lt;!--/notypo-->&amp;laquo;.&lt;br />
&lt;em>ePacketOfDisconnect&lt;/em>. Звонок завершен в&amp;nbsp;принудительном порядке при&amp;nbsp;получении от&amp;nbsp;RADIUS-сервера пакета &lt;!--notypo-->PacketOfDisconnect&lt;!--/notypo-->.&lt;br />
&lt;em>eMaxSessionTime&lt;/em>. Превышено максимальное время звонка (выдается Radius-сервером как&amp;nbsp;CISCO_H323_CREDIT_TIME)&lt;br />
&lt;em>eDanglingCall&lt;/em>. Превышена максимальная длительность звонка (10000 секунд, около 3-х часов), предполагается, что&amp;nbsp;это зависший звонок.&lt;br />
&lt;em>eSystemOverflow&lt;/em>. Превышено количество одновременных звонков, указанных в&amp;nbsp;лицензионном соглашении.&lt;br />
&lt;em>eSourceGatewayExpired&lt;/em>. Истекла дата, заданная в&amp;nbsp;expire_date у&amp;nbsp;шлюза-оригинатора звонка.&lt;br />
&lt;em>eDestinationGatewayExpired&lt;/em>. Истекла дата expire_date у&amp;nbsp;терминатора звонка.&lt;br />
&lt;em>eIncomingTrafficExceeded&lt;/em>. Превышен лимит, определенный в&amp;nbsp;max_incoming_time.&lt;br />
&lt;em>eOutgoingTrafficExceeded&lt;/em>. Превышен лимит времени, заданный в&amp;nbsp;max_outgoing_time.&lt;br />
&lt;em>eNoMediaServer&lt;/em>. Отсутствие Media MVTS серверов для&amp;nbsp;терминации звонка с&amp;nbsp;сигнального MVTS.&lt;br />
&lt;em>eFailedTCPConnectMediaServer&lt;/em>. Ошибка в&amp;nbsp;установлении TCP-соединения с&amp;nbsp;Media MVTS.&lt;/div>&lt;br />
